/*
Returns a string of lorem ipsum words
@author C. Peter Chen (wrote original script at http://dev-notes.com/code.php?q=37)
@author Adam Courtemanche of http://agileadam.com (modified code for use in Selenium lipsumtext extension)
@author Tom Jackson of http://tomjackson.name added hipster ipsum!
*/
function getWords(minWordCount, maxWordCount, useWordCaps, useMarks) {
 var loremIpsumWordBank = new Array("Lorem", "ipsum", "dolor", "sit", "amet,", "consectetur", "adipiscing", "elit", "Vivamus", "nec", "feugiat", "ligula", "Vivamus", "dignissim", "arcu", "mi,", "ut", "porta", "leo", "tempor", "ac", "Cum", "sociis", "natoque", "penatibus", "et", "magnis", "dis", "parturient", "montes,", "nascetur", "ridiculus", "mus", "Nam", "ante", "tortor,", "elementum", "vitae", "nisl", "sit", "amet,", "egestas", "consequat", "nibh", "Sed", "vel", "tellus", "magna", "Duis", "quis", "lectus", "et", "metus", "cursus", "congue", "Fusce", "nec", "diam", "vitae", "nisi", "mattis", "commodo", "Nam", "vestibulum", "eros", "non", "ante", "sagittis,", "eget", "ornare", "orci", "aliquam", "Fusce", "tempus", "sollicitudin", "euismod", "Pellentesque", "habitant", "morbi", "tristique", "senectus", "et", "netus", "et", "malesuada", "fames", "ac", "turpis", "egestas", "Suspendisse", "blandit", "facilisis", "massa", "quis", "iaculis" );

    // By default, use the minWordCount as the number of words. If min and max are different,
    // get a random value between them
    var numWords = minWordCount;
    if (minWordCount != maxWordCount) {
        numWords = Math.floor(Math.random() * (maxWordCount - minWordCount)) + minWordCount;
    }

    var ret = "", i = 0;
    for (i = 0; i < numWords; i += 1) {
        var newTxt = loremIpsumWordBank[Math.floor(Math.random() * (loremIpsumWordBank.length - 1))];
        if (useMarks) {
            if (ret.substring(ret.length - 1, ret.length) === "." || ret.substring(ret.length - 1, ret.length) === "?") {
                newTxt = newTxt.capitalizeFirstLetter();
            }
        }

        if (useWordCaps) {
            newTxt = newTxt.capitalizeFirstLetter();
        }

        ret += " " + newTxt;
    }

    // Remove beginning space
    ret = ret.replace(/(^[ ])/, "");

    // Remove end punctuation marks
    ret = ret.replace(/([.?, ]$)/gi, "");

    // Capitalize the string and add a period at the end
    ret = ret.capitalizeFirstLetter() + ".";

    if (useMarks === false) {
        // Remove all punctuation marks
        ret = ret.replace(/([.?,])/gi, "");
    }

    return ret;
}
/*
Provides a string method to capitalize the first letter of a string
*/
String.prototype.capitalizeFirstLetter = function() {
    return this.charAt(0).toUpperCase() + this.slice(1);
};

//RANDOM GENREATOR AS FOUND ON seleniumIDE.blogspot.com
// ADDED 8/12/2013
Selenium.prototype.doRandomString = function( options, varName ) {

    var length = 8;
    var type   = 'alphanumeric';

    var o = options.split( '|' );

    for ( var i = 0 ; i < 2 ; i ++ ) {
        if ( o[i] && o[i].match( /^\d+$/ ) )
            length = o[i];

        if ( o[i] && o[i].match( /^(?:alpha)?(?:numeric)?$/ ) )
            type = o[i];
    }

    switch( type ) {
        case 'alpha'        : storedVars[ varName ] = randomAlpha( length ); break;
        case 'numeric'      : storedVars[ varName ] = randomNumeric( length ); break;
        case 'alphanumeric' : storedVars[ varName ] = randomAlphaNumeric( length ); break;
        default             : storedVars[ varName ] = randomAlphaNumeric( length );
    };
};

function randomNumeric ( length ) {
    return generateRandomString( length, '0123456789'.split( '' ) );
}

function randomAlpha ( length ) {
    var alpha = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ'.split( '' );
    return generateRandomString( length, alpha );
}

function randomAlphaNumeric ( length ) {
    var alphanumeric = '01234567890abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ'.split( '' );
    return generateRandomString( length, alphanumeric );
}

function generateRandomString( length, chars ) {
    var string = '';
    for ( var i = 0 ; i < length ; i++ )
        string += chars[ Math.floor( Math.random() * chars.length ) ];
    return string;
}

